import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 2.2-1833 Property and insurance records to be maintained.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-1833.md","filePath":"vacode/2.2-1833.md"}'),n={name:"vacode/2.2-1833.md"},i=t('<h1 id="§-2-2-1833-property-and-insurance-records-to-be-maintained" tabindex="-1">§ 2.2-1833 Property and insurance records to be maintained. <a class="header-anchor" href="#§-2-2-1833-property-and-insurance-records-to-be-maintained" aria-label="Permalink to &quot;§ 2.2-1833 Property and insurance records to be maintained.&quot;">​</a></h1><p>The Division shall establish and maintain a file of state-owned buildings and contents, hereinafter inclusively referred to as buildings or properties, and the actual cash value or replacement cost value if insured or replacement cost basis thereof, and the amount of fire and extended coverage, vandalism and malicious mischief, optional perils or all risk insurance coverage thereon. All agencies of the Commonwealth shall keep the Division informed as to the status of all properties under their control.</p><p>1980, c. 488, § 2.1-526.2; 1982, c. 318; 1988, c. 848; 2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0618" target="_blank" rel="noreferrer">618</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0632" target="_blank" rel="noreferrer">632</a>, § 2.1-191.6; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844" target="_blank" rel="noreferrer">844</a>.</p>',3),o=[i];function s(c,l,d,p,h,_){return a(),r("div",null,o)}const m=e(n,[["render",s]]);export{u as __pageData,m as default};
